import React from "react";

import Button from "../Button/Button";
import { DataEntryStyle, InputStyle } from "./DataEntryStyle";
const DataEntry = (props) => {
  const {
    inputValue,
    addUser,
    onChangeInput,
    onPressEnterInput,
    onClickButton,
  } = props;

  return (
    <DataEntryStyle>
      <InputStyle
        placeholder="Write..."
        value={inputValue}
        onChange={(event) => onChangeInput(event.target.value)}
        onPressEnter={(event) => onPressEnterInput(event.target.value)}
      />
      <Button onClick={() => onClickButton()}>
        <p style={{ fontSize: "20px" }}>{"Save"}</p>
      </Button>
    </DataEntryStyle>
  );
};

export default DataEntry;
